import React, { Component } from 'react';
import Bench from './Components/bench';
import Deadlift from './Components/deadlift';
import Squat from './Components/deadlift';
import Press from './Components/press';
import './App.css'
import NaviBar from './Components/NaviBar';
import { library } from '@fortawesome/fontawesome-svg-core';
import { fas, faAngleDown, faCheckSquare, faCoffee } from '@fortawesome/free-solid-svg-icons';

library.add(fas, faAngleDown, faCheckSquare, faCoffee);


class App extends Component {
  render() {
    return (
      <div>
        <NaviBar />
        <div className="App">
          <div>
            <header className="App-header">Dead</header>
          </div>
          <div>
            <Bench className="Bench"/>
            <Deadlift className="Deadlift"/>
            <Squat className="Squat"/>
            <Press className="Press"/>
          </div>
        </div>
      </div>

    );
  } 
}

export default App;
